// Quick lookup by color ID
export const COLORS_BY_ID: Record<string, ColorData> = Object.fromEntries(
  COLORS_DATA.map(color => [color.id, color])
);

// Quick lookup by color name
export const COLORS_BY_NAME: Record<string, ColorData> = Object.fromEntries(
  COLORS_DATA.map(color => [color.name, color])
);

// Get color by ID
export function getColorById(id: string): ColorData | undefined {
  return COLORS_BY_ID[id];
}

// Get color by name
export function getColorByName(name: string): ColorData | undefined {
  return COLORS_BY_NAME[name];
}

// Get all color IDs
export function getAllColorIds(): string[] {
  return COLORS_DATA.map(c => c.id);
}

// Get all color names
export function getAllColorNames(): string[] {
  return COLORS_DATA.map(c => c.name);
}
